import NFLPlayer from './NFLPlayer'

const sortTypes = {
  YdsUp: {
    class: 'yds-up',
    fn: (a, b) => a.Yds - b.Yds
  },
  YdsDown: {
    class: 'yds-down',
    fn: (a, b) => b.Yds - a.Yds
  },
  LngUp: {
    class: 'lng-up',
    fn: (a, b) => a.Lng - b.Lng
  },
  LngDown: {
    class: 'lng-down',
    fn: (a, b) => b.Lng - a.Lng
  },
  TdUp: {
    class: 'td-up',
    fn: (a, b) => a.TD - b.TD
  },
  TdDown: {
    class: 'td-down',
    fn: (a, b) => b.TD - a.TD
  },
  default: {
    class: 'sort',
    fn: (a,b) => a
  }
}

const NFLPlayerTableBody = ({ nflPlayers }) => {
  return (
    <div>
      <thead>
        <tr>
          {
            Object.keys(nflPlayer).map((key) => {
              return (
                <th key={key}>
                  <h3>{key}</h3>
                </th>
              )
            })
          }
        </tr>
      </thead>
      <tbody>
        {nflPlayers.sort(sortTypes["TdDown"].fn).map((nflPlayer, index) => (
          <NFLPlayer key={index} nflPlayer={nflPlayer} />
        ))}
      </tbody>
    </div>
  )
}

export default NFLPlayerTableBody
